import { arrayToTree } from '@/common/util/Trees.js';
export default {
  data: function data() {
    return {
      waiting: false,
      item: {
        name: null,
        cars: [],
        area: null,
        des: null,
        regions: [],
        auser: $_main.userId
      },
      cars: [],
      regions: [],
      callback: null
    };
  },

  mounted() {
    if (this.item.id) {
      this.regions = JSON.parse(this.item.regions);
    }
  },

  methods: {
    iconCssFunction(node, open) {
      return !node.carId ? open ? 'ico_open' : 'ico_close' : null;
    },

    iconCssFunction1(node, open) {
      return node.type == '0' ? open ? 'ico_open' : 'ico_close' : null;
    },

    getTreeRoots(callback) {
      $_main.http.get('data/getCars', {
        sessionId: $_main.sessionId
      }).then(result => {
        result.carList.forEach(el => {
          el.id = el.carId;
          el.pid = el.teamId;
          el.name = el.carName;
        });
        result.teamList.forEach(el => {
          el.id = el.teamId;
          el.name = el.teamName;
        });
        let root = {
          id: '0',
          name: $_L.get('所有车辆'),
          children: []
        };
        let children = arrayToTree(result.teamList.concat(result.carList));
        children.forEach(node => node.parent = root);
        root.children = children;
        callback(root);
      });
    },

    getTreeRoots1(callback) {
      $_main.http.get('data/getPois', {
        sessionId: $_main.sessionId
      }).then(result => {
        let root = {
          id: '0',
          name: $_L.get('所有标注'),
          children: []
        };
        let children = arrayToTree(result);
        children.forEach(node => node.parent = root);
        root.children = children;
        callback(root);
      });
    },

    getTreeRoots2(callback) {
      $_main.http.get('data/getRegions', {
        sessionId: $_main.sessionId
      }).then(result => {
        let root = {
          id: '0',
          name: $_L.get('所有区域'),
          children: []
        };
        let children = arrayToTree(result);
        children.forEach(node => node.parent = root);
        root.children = children;
        callback(root);
      });
    },

    addAiItemClick() {
      this.regions.push({
        regionId: null,
        speed: null,
        mile: null,
        rev: null,
        gear: null,
        appPid: null
      });
    },

    submit() {
      if (!this.item.name) return $_alert.warn($_L.get('请输入工况名称！')); // if(!this.item.area)return $_alert.warn($_L.get('请填写所在地区！'));

      if (!this.regions || this.regions.length == 0) return $_alert.warn($_L.get('请添加标注，标注不能小于1个！'));

      for (let k in this.regions) {
        if (!this.regions[k].regionId) return $_alert.warn($_L.get('请选择标注点！'));
      }

      let isadd = this.item.id ? false : true;
      let url = this.item.id ? 'rule/update' : 'rule/add'; // this.item.cars=this.cars.toString()

      this.item.regions = JSON.stringify(this.regions);
      $_main.http.post(url, this.item).then(result => {
        this.callback(result, isadd);
        $_alert.success(isadd ? $_L.get('新增成功') : $_L.get('修改成功'));
        this.$refs.w.close();
      }).catch(error => {
        this.waiting = false;
      });
    }

  }
};
